import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Main from './pages/main';
import './pages/home.css';
import APULogo from './assets/APULogo.png';
import { Link } from 'react-router-dom';

import headerLink1 from "./components/headerLink1"

// Links to respective chat widget

const headerCont = {
  backgroundColor: "#990000",
  height: "60px",
  width: "100%",
}
const Logo = {
  marginLeft: "10px",
  marginTop: "5px",
  height: "50px"
}
const Name = {
  color: "#fff",
  marginTop: "10px",
  marginLeft: "30px"
}
const firstLinkStyle = {
  fontSize: "10",
  marginLeft: "75%",
  marginTop: "20px",
}

class App extends React.Component {
  render() {
    return (
      <div>
        <div className="headerContainer" id="header" style={headerCont}>
          <img src={APULogo} style={Logo}/>
          <h1 style={Name}>Libary Help Kiosk</h1>
          <Link to="/">
            <p style={firstLinkStyle}>APU Support Chat</p>
          </Link>
        </div>
        <Main></Main>
      </div>
    );
  }
}

export default App;
